import Card from "../UI/Card";
import "./UserAdd.css";

const UserAdd = () => {
  return (
    <Card>
      <form className="form-control">
        <label>Ime korisnika</label>
        <input type="text" placeholder="Unesite ime" />
        <label>Email korisnika</label>
        <input type="text" placeholder="Unesite email" />
      </form>
    </Card>
  );
};

export default UserAdd;
